Battle of Britain: The Day the War Was Won
Dermot O'Leary presents a documentary examining the stories of those who were involved in the decisive Second World War air battle, featuring the personal accounts of fighter pilots, ground crew members and support staff charged with tracking aircraft movements in the RAF's operations centres. Plus, Arthur Williams meets two former servicemen who are training to pilot spitfires at Boultbee Flight Academy, so they can take part in a ceremonial flypast to mark the 75th anniversary of the battle's conclusion.

